import "./Inicio.css"; 
import Menu from "../../Menu";


const Inicio = () => {

  return (
    <div className="container">
    <div className="item item1"><Menu /></div>
    <div className="item item2-1">Coluna 2, Linha 1</div>
  </div>

  );
};

export default Inicio;
